import React from "react";
import donut from "../assets/about_desktop/donut.png";
import instaIcon from "../assets/insta_icon.png";
import phoneIcon from "../assets/phone_icon.png";
import locIcon from "../assets/loc_icon.png";
import emailIcon from "../assets/email_icon.png";

const AboutDesktop: React.FC = () => {
  return (
    <div
      style={{
        width: "100vw",
        height: "100vh",
        display: "flex",
        backgroundColor: "#987384",
        color: "black",
        fontFamily: "'Comic Sans MS', cursive, sans-serif",
        overflow: "hidden",
      }}
    >
      {/* Left Side */}
      <div style={{ width: "50%", padding: "40px", boxSizing: "border-box", display: "flex", flexDirection: "column", justifyContent: "space-between" }}>
        {/* Top Text */}
        <div style={{ fontSize: "1.2rem", lineHeight: "1.8" }}>
          <p>From the Founder of<br />
            <strong>Spread Bagelry</strong><br />
            Comes a ‘Hole’ New Experience in<br />
            Coffee & Donuts
          </p>
          <p style={{ marginTop: "20px" }}>
            Homemade Pancake Donuts & Toppings<br />
            Sweet/Savory<br />
            Great Coffee
          </p>
        </div>

        {/* Bottom Email Input */}
        <div style={{ marginTop: "auto" }}>
          <p style={{ fontSize: "1.2rem", marginBottom: "10px" }}><i>Join our Inner Circle!</i></p>
          <form
            onSubmit={(e) => {
              e.preventDefault();
              const email = (e.target as any).email.value;
              alert(`Submitted: ${email}`);
            }}
            style={{
              display: "flex",
              alignItems: "center",
              gap: "10px",
              backgroundColor: "#fff",
              borderRadius: "20px",
              padding: "5px 10px",
              width: "fit-content",
            }}
          >
            <input
              type="email"
              name="email"
              placeholder="Email Address"
              required
              style={{
                border: "none",
                outline: "none",
                padding: "8px",
                borderRadius: "20px",
                fontSize: "1rem",
              }}
            />
            <button
              type="submit"
              style={{
                backgroundColor: "#bbb",
                border: "none",
                padding: "6px 16px",
                borderRadius: "20px",
                cursor: "pointer",
              }}
            >
              Submit
            </button>
          </form>
        </div>
      </div>

      {/* Right Side */}
      <div style={{ width: "50%", position: "relative", height: "100%" }}>
        {/* Donut image */}
        <img
          src={donut}
          alt="Donut"
          style={{
            position: "absolute",
            top: "50%",
            left: "50%",
            transform: "translate(-50%, -50%)",
            maxHeight: "100%",
            maxWidth: "100%",
            objectFit: "contain",
          }}
        />

        {/* Contact Info */}
        <div
          style={{
            position: "absolute",
            right: "40px",
            top: "50%",
            transform: "translateY(-50%)",
            display: "flex",
            flexDirection: "column",
            gap: "20px",
            fontSize: "1.1rem",
          }}
        >
          <ContactRow icon={instaIcon} text="@ringocoffeeanddonuts" />
          <ContactRow icon={locIcon} text="2001 Federal St, Philadelphia, PA 19146" />
          <ContactRow icon={phoneIcon} text="(215) 594-2802" />
          <ContactRow icon={emailIcon} text="info@ringocoffee.com" />
        </div>
      </div>
    </div>
  );
};

const ContactRow = ({ icon, text }: { icon: string; text: string }) => (
  <div style={{ display: "flex", alignItems: "center", gap: "12px" }}>
    <img src={icon} alt="icon" style={{ width: "28px", height: "28px" }} />
    <span>{text}</span>
  </div>
);

export default AboutDesktop;
